function imprimirTablaMenAl() {
    let contenido = "";
    for (let i = 0; i < listaAlimentos.alimentosMenu.length; i++) {
        let renglon = "";
        renglon += "<tr>";
        renglon += "<td>" + listaAlimentos.alimentosMenu[i].id + "</td>";
        renglon += "<td>" + listaAlimentos.alimentosMenu[i].nombre + "</td>";
        renglon += "<td>" + listaAlimentos.alimentosMenu[i].descripcion + "</td>";
        renglon += "<td>" + listaAlimentos.alimentosMenu[i].categoria + "</td>";
        renglon += "<td>" + listaAlimentos.alimentosMenu[i].precio + "</td>";
        renglon += "<td>" + listaAlimentos.alimentosMenu[i].estatus + "</td>";
        renglon += "<td> <img src= " + listaAlimentos.alimentosMenu[i].foto + " alt='alt' height='100' width='100'></td>";
        renglon += "<td><button type='button' onClick='addMen(" + i + "," + 1 + ");' class='btn btn-lg'>\n\
        <i class='fa-solid fa-plus fa-2xl' style='color: #FAAF08'></i></button></td>";
        renglon += "</tr>";
        contenido += renglon;
    }
    document.getElementById("contAl").innerHTML = contenido;
}

