function imprimirComAl(items) {
    let contenido = "";
    for (let i = 0; i < items.length; i++) {
        let item = items[i];
        let renglon = "";
        renglon += "<tr>";
        renglon += "<td>" + item.nombre + "</td>";
        renglon += "<td>" + item.descripcion + "</td>";
        renglon += "</tr>";
        contenido += renglon;
    }
    return contenido;
}

